import React from "react";
import logo from "./images/logoimg.png";
import callicon from "./images/support.svg";
const Navbar = () => {
  return (
    <div>
      <div className="  logovscall">
        <div class="row">
          <div class="col-sm-7 ">
            <div className="logodiv">
              <img src={logo} />
              <h3>FIZMASOFT</h3>
            </div>
          </div>
          <div class="col-sm-5 ">
            <img src={callicon} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
